import React from 'react';
import { NavLink } from 'react-router-dom';
const Error = () =>{
    return(
        <>
        <h2> 404 Error Page</h2>
        <p>Welcome to my world</p>
        <NavLink to='/' >Go Back</NavLink>
        </>
    )
}

export default Error;
